import React from "react";
import { useNavigate } from "react-router-dom";

export const Update = ({ id, content }) => {
  const navigate = useNavigate();
  const updateTodo = () => {
    fetch(`/api/update/${id}`, {
      method: "POST",
      body: JSON.stringify({
        id: id,
        content: content,
      }),
    })
      .then((response) => response.json())
      .then((data) => {
        console.log(data);
        navigate("/");
      });
  };
  return (
    <>
      <button onClick={updateTodo}>Update</button>
    </>
  );
};
